win系统修改15441固定端口！首先新建一个TXT文件，把以下复制粘贴
 import socket
    import os
    from random import randint

    try: 
        while 1:
            port = randint(32768, 61000)
            s = socket.socket(socket.AF_INET, socket.SOCK_STREAM)
            result = s.connect_ex(("localhost", port))
            if result != 0:
                os.system("E:\p2p网站备份\Zeronet\Zeronet-v0.1.1\Zeronet-v0.1.1\Python\python.exe zeronet.py --fileserver-port {}".format(port))
                s.close()
                break
            s.close()
    except KeyboardInterrupt:
        sys.exit()

另存为runzp.py，记得把文本中python.exe修改成本地存放程序文件！
然后把runzn.py放到ZeroNet这个文件夹外面，然后刚才你发的那个改成：
